import * as React from 'react';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Title from './src/Title';
import Desc from './src/Desc';

export default function SimplePaper() {
  return (
    <Box
      sx={{
        display: 'flex',
        flexWrap: 'wrap',
        flexGrow: 1,
        '& > :not(style)': {
          m: 1,
          width: '100%',
          height: '100vh',
        },
      }}
    >
      <Paper elevation={3}>
        <div>
        <Title  />
        <Desc />
        </div>
      </Paper>
    </Box>
  );
}
